import './App.css';
import { useFormik } from 'formik';

function App() {
  return (
    <div>
      <form>
        <div>Name</div>
        <input id="name" type="text" />
        <div>Email</div>
        <input id="name" type="text" />
        <div>Password</div>
        <input id="name" type="text" />
        <button type="submit">Submit</button>
      </form>

    </div>
  );
}

export default App;
